function App() {
  return (
  <div className='Wrapper'>
    <header className='header'>
      <img src="https://upload.wikimedia.org/wikipedia/commons/d/db/Zeronet_logo.png" alt="LOGO" className="header__logo" />
    </header>
    <nav className='sideBar'>
      <ul className='sideBar__list'> 
        <li>Profile</li>
        <li>Messages</li>
        <li>Frends</li>
        <li>Settings</li>
      </ul>
    </nav>
    <nav className="mainContent">
      <img src="https://www.industrialempathy.com/img/remote/ZiClJf-1920w.jpg" alt="content-img" className="mainContent__content-img" />
    </nav>
  </div>
  );
}




